/*Table structure for table `aux_prioridade` */

DROP TABLE IF EXISTS `aux_prioridade`;

CREATE TABLE `aux_prioridade` (
  `id_prioridade` int(11) NOT NULL AUTO_INCREMENT,
  `desc_prioridade` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `legenda` longtext COLLATE utf8_unicode_ci DEFAULT NULL,
  `sla` time DEFAULT NULL,
  `hex_color` varchar(7) COLLATE utf8_unicode_ci DEFAULT NULL,
  `index_letra` varchar(1) COLLATE utf8_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id_prioridade`)
) ENGINE=MyISAM AUTO_INCREMENT=5 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

/*Data for the table `aux_prioridade` */

insert  into `aux_prioridade`(`id_prioridade`,`desc_prioridade`,`legenda`,`sla`,`hex_color`,`index_letra`) values (1,'Critico','O problema/solicitao/dvida impede que a empresa realize seus processos basicos?<br/><br/>\r\n									O problema/solicitao/dvida impede a execuo de algum servico da empresa?<br/><br/>\r\n									O problema/solicitao/dvida impede que o solicitante realize sua funo?','00:30:30','#F3565D','A'),(2,'Alta','O problema/solicitao/dvida do solicitante no o impede de realizar as atividades, mas causa retardo na execuo das tarefas?','02:00:00','#DFBA49','B'),(3,'Media','O problema/solicitao/dvida do solicitante no o impede de realizar as atividades, nem causa retardo na execuo das tarefas, mas o ajudaria a fazer o trabalho melhor?<br/><br/>\r\n									O problema/solicitao/dvida impede que do solicitante realize funcoes secundarias?','08:00:00','#89C4F4','C'),(4,'Baixa','O problema/solicitao/dvida nao se encaixou em nenhuma das categorias? <br/></br>\r\n(!) Aqui eh preciso ter cuidado com os falsos positivos. Como nossa estrutura de atribuicao de prioridade eh simples, pode ser que algum item que caia aqui nao seja de prioridade baixa. Fique atento!','14:00:00','#C6C6C6','D');

