/*Data for the table `aux_tempo_garantia` */

insert  into `aux_tempo_garantia`(`id_tempo_garantia`,`desc_tempo_garantia`) values (1,'Por tempo indeterminado'),(2,'30 Dias'),(3,'3 Meses'),(4,'6 Meses'),(5,'12 Meses'),(6,'18 Meses');

