insert  into `eve_utilizacao_sala`(`id_utilizacao_sala`,`desc_utilizacao_sala`,`desc_definicao`,`token_id`,`token_company`,`id_usuario_criacao`,`dth_criacao`,`id_usuario_atualizacao`,`dth_atualizacao`,`sit_ativo`) values (3,' definir pelo Cliente',NULL,'08E8A0FDCC326E741B983E971520CB29','260635a09da31c7fd54.08270071',1,'2019-09-26 15:47:48',1,'2019-09-26 15:47:48','S'),(4,'Casamento',NULL,'CA59799ABD8199080F27D6C3D7BC3A4F','260635a09da31c7fd54.08270071',1,'2019-09-26 15:48:04',1,'2019-09-26 15:48:04','S'),(5,'Cocktail',NULL,'04D655DCD65E23CB897CF0A5714FC9CE','260635a09da31c7fd54.08270071',1,'2019-09-26 15:57:57',1,'2019-09-26 15:57:57','S'),(6,'Conveno','Reunio de profissionais de uma mesma empresa ou profissionais equivalentes de empresas diferentes. Convenes podem ser de diversos tipos: vendas, lanamento de produto, congraamento e comemoraes. Debate Discusso entre dois oradores, comprometidos a defender um ponto de vista em torno de determinado assunto, o pblico interage somente com aplausos ou protestos no-formais.','F76E451D92352019A490BA4D9309537A','260635a09da31c7fd54.08270071',1,'2019-09-26 15:58:10',1,'2019-09-26 16:20:05','S'),(7,'Formatura',NULL,'71644203270F7AE31AF466753C5293AF','260635a09da31c7fd54.08270071',1,'2019-09-26 15:58:20',1,'2019-09-26 15:58:20','S'),(8,'Palestra',' o mtodo de discusso mais comum. Apresenta-se questes sobre um assunto e na sequncia inicia-se perguntas e debates com a platia buscando concluses. Pode ter como complemento demonstraes ou exerccios de laboratrio.','3D7FC611D56EEF0E433473C6B000A7CE','260635a09da31c7fd54.08270071',1,'2019-09-26 15:58:30',1,'2019-09-26 16:20:50','S'),(9,'Plenario',NULL,'47118104ACA9E5B266849EA92274DC34','260635a09da31c7fd54.08270071',1,'2019-09-26 15:58:38',1,'2019-09-26 15:58:38','S'),(10,'Reunio',NULL,'3B9E05CB326A3F199124A5C0AE6C662F','260635a09da31c7fd54.08270071',1,'2019-09-26 15:58:49',1,'2019-09-26 15:58:49','S'),(11,'Sala de Apoio',NULL,'6647AEB39B716085ECADEE3DC9E8D8F4','260635a09da31c7fd54.08270071',1,'2019-09-26 15:59:06',1,'2019-09-26 15:59:06','S'),(12,'Treinamento',NULL,'75563BC8A90BFAC07B4B8CD1DB747834','260635a09da31c7fd54.08270071',1,'2019-09-26 15:59:16',1,'2019-09-26 15:59:16','S'),(13,'Workshop',NULL,'A1941CA6F8E07DAB1719746448EDEF49','260635a09da31c7fd54.08270071',1,'2019-09-26 15:59:22',1,'2019-09-26 15:59:22','S'),(14,'Congresso',' um conjunto de vrias sesses de trabalho previamente definidas. Geralmente restrito a grupos associativos, categorias de profissionais ou linhas acadmicas. Os congressos tm por objetivo de apresentar e debater assuntos de interesse especfico de um segmento. Em um nico congresso, pode-se ter, simultaneamente ou sequencial, palestras, conferncias, mesa-redondas, debates e seminrios. Um congresso tambm pode ser acompanhado de feiras voltadas para o pblico presente.','98276169E8ADC084175E010323FB0DEB','260635a09da31c7fd54.08270071',1,'2019-09-26 15:59:46',1,'2019-09-26 16:18:13','S'),(15,'Conferncia',' a exposio feita por uma autoridade em um determinado assunto para um grande nmero de pessoas. Conta com a presena de um presidente de mesa para conduo da apresentao, segue uma linha mais formal que uma palestra. Na conferncia, perguntas so feitas somente por escrito e devidamente identificadas ao trmino da apresentao.','77E51583497446B7F7CB88CBA0DC12E9','260635a09da31c7fd54.08270071',1,'2019-09-26 16:00:00',1,'2019-09-26 16:58:48','S'),(16,'Frum',' uma reunio baseada na busca da participao intensa da platia, preferencialmente formada por um grande nmero de pessoas. Um coordenador d o tema de interesse geral e busca a opinio da platia. Ocorre um debate livre at que concluses possam ser obtidas.','A4EA6819A87CDA0B3D09F8C90123117B','260635a09da31c7fd54.08270071',1,'2019-09-26 16:00:24',1,'2019-09-26 16:20:17','S'),(17,'Mesa redonda','Reunio com um tempo especfico para o questionamento pelos especialistas convidados das teses apresentadas pelos colegas. H ampla discusso antes mesmo da participao da audincia.','CDDE0F84BA23269DA37CA493E06F28E0','260635a09da31c7fd54.08270071',1,'2019-09-26 16:01:04',1,'2019-09-26 16:20:28','S'),(18,'Painel','Reunio questionadora, que se resume para um grande grupo o teor de apresentaes feitas por um grupo menor, ficando este disposto de preferncia em mesa de semicrculo com o presidente ao centro. H ampla discusso e, geralmente, discusses polmicas.','ACE29C0981E6A801EB2BBF1D9DBA701A','260635a09da31c7fd54.08270071',1,'2019-09-26 16:01:12',1,'2019-09-26 16:20:37','S'),(19,'Simpsio',' uma reunio de especialistas de renome, sob a direo de um moderador, para apresentao de tema cientfico  um pblico especfico. Os especialistas desenvolvem partes de um mesmo tema, e posteriormente entre si desenvolvem uma fase de debate. O coordenador do simpsio apresenta os especialistas e introduz os tpicos de cada assunto. O pblico participa somente no final, com perguntas escritas e identificadas, de carter complementar, sem teor de polmica.','0495813C3DDB29C25F9210601438A049','260635a09da31c7fd54.08270071',1,'2019-09-26 16:01:23',1,'2019-09-26 16:21:04','S'),(20,'Seminrio',' uma sequncia de atividades para desenvolver capacidades, conhecimento e aprendizagem por meio de instrutores especializados. O objetivo  somar informaes e experincias, sem a necessidade de chegar a concluses ou resultados. Um seminrio pode durar um dia ou at vrias semanas.','4E3C80A504280BAB9DFA2CC89B9B8E5B','260635a09da31c7fd54.08270071',1,'2019-09-26 16:01:32',1,'2019-09-26 16:21:15','S'),(21,'Brainstorming','Realiza-se atravs da estimulao livre do mente dos participantes para estimular a ideias com vista  soluo de problemas. Grupos de pessoas so orientadas a emitir ideias sobre uma questo, que vo sendo trocadas e aperfeioadas sem juzo prvio de valor.','2BC4B15BBCB175578481E18CB25EC391','260635a09da31c7fd54.08270071',1,'2019-09-26 16:01:37',1,'2019-09-26 16:21:29','S');

